class UmHymnsEvening {
  static List<HymnsContent> list = [
    HymnsContent(id: 3093, position: 1, content: "Lalipo. Lalipo. Lalipo,\nKueya vali owelema.\nKilu ku moleha vali\nOlombungululu viulu,\nVi pakula ndolovela.\nLalipo. Lalipo. Lalipo.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_349, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3094, position: 2, content: "Lalipo. Lalipo. Lalipo,\nKolowola viowelema\nKu li Umue o tu lava,\nEye Ungombo wolomeme\nWa vi ecela omuenyo waye.\nLalipo. Lalipo. Lalipo.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_349, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3095, position: 3, content: "Lalipo. Lalipo. Lalipo.\nHela, eci tu pasuka.\nTu imba vali olopandu\nKuna o tu ihaiha omuenyo\nLevi viosi via posoka.\nLalipo. Lalipo. Lalipo.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_349, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3096, position: 1, content: "Oñolosi yilo, a Yesu,\nLava ovimuenyo vietu.\nNda tua lueya ndo tu ecele;\nOve muele ukuahenda.\nNdaño owelema wa lua,\nKo ku vindikiya sio.\nKu kasi lolukavelo\nOku tata omanu vove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_350, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3097, position: 2, content: "Nda tu li oku nyelela\nOve lika o tu teyuila.\nTua ñualiwa lovangelo\nVa tu vindikiya ciwa.\nNdaño tu fa uteke ulo\nKuenje ula wetu eyambo,\nHaimo tu pasula vali\nKimbo liove liokovailu.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_350, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3098, position: 3, content: "Anjovoli, tua leñela,\nNdo tu lingile onyima.\nNdo tu pekelise ciwa\nToke eci ku ca omele.\nTu vutame, a Spiritu,\nSikulula owelema\nKu ce omele ya posoka\nKu tue utanya una ko pui.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_350, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3099, position: 1, content: "Ekumbi eci lia iñila\nVa vela, a Yesu,\nVosi veyile kokuove,\nVa kaya ocili.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_351, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3100, position: 2, content: "A Yesu, mbela kutima\nCa linga oñolosi,\nNdomo wa sakuaile osimbu,\nCi linga etaili.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_351, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3101, position: 3, content: "Ka ku li omunu ka kuete\nApute kutima.\nKa ku li u wa kanguka,\nTe nda wo kolisa.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_351, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3102, position: 4, content: "Ekumbi eci lia iñila\nA Yesu, tu eyavo.\nTu veluisevo kitima,\nTu kaye ocili.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_351, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3103, position: 1, content: "A Suku, eteke wa tu iha lia pita,\nWa nena vali owelema.\nTua ku sivaya lisungo viomele,\nUteke tu imbavo olopandu kokuove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_352, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3104, position: 2, content: "Ekumbi lia tu sia lia ka pasulavo,\nVakuetu kolofeka viñi.\nOwola wosi alimi añi añi\nA imbaimba esivayo liohenda ya Suku.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_352, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3105, position: 3, content: "Ocinyi comele ca taka vuteke,\nPuãi haimo ekongelo liove.\nKoluali luosi ka li liwekapo\nOku imba esivayo lia Suku yeyovo.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_352, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3106, position: 4, content: "Usoma wa Suku ko kuete efulilo,\nNdusoma waño wilu lieve.\nPuãi wamamako lunene lulamba\nTe vosi va tava ocili kokuove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_352, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3107, position: 1, content: "Ndo kale kumue lame vuteke;\nKuiya owelema, ka mbetatele\nÑolela uhiti wove, ndo ndave;\nA Yesu, kumue lame ndo kale.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_353, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3108, position: 2, content: "Va nyale tupu ha va mungika,\nLutima wa suvala lusumba.\nVohondongolo yove mbundise;\nA Yesu, kumue lame ndo kale;", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_353, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3109, position: 3, content: "Ha sanga esanju ku Ñala Yesu,\nEtimba liange lika pinduka.\nNoke ha kala  kulamba wahe,\nLa Suku kumue la'e ha tumala.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_353, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3110, position: 4, content: "Omuenyo ulo, eci wimuha,\nÑokela kuna alende a tokeka.\nNdalela kilu, hela ngendise,\nA Yesu kumue lame ndo kale!", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_353, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3111, position: 1, content: "Tuli utanya wa enda\nOñolosi yeya,\nVosi va lembuka\nHa va puyukapo.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_354, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3112, position: 2, content: "Ndo tu lave, a Yesu,\nOco tu puyuke,\nLoku kuata ongusu\nYoku talavaya.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_354, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3113, position: 3, content: "Ndo kuatise, a Yesu,\nAva va yavala;\nLava va yonjaiwa\nVa iha ongusu yove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_354, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3114, position: 4, content: "Eci ku ca omele\nTu pasule ciwa.\nHa tu ka ku vumba\nLonjolela ya lua.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_354, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3115, position: 1, content: "Enju, a Yesu, ndutanya womele,\nTumbulula itima vietu.\nNdeci utanya u tuila oluali\nHaico ndo tuile omanu vove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_355, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3116, position: 2, content: "Enju, a Yesu, ndeposo liomele;\nSunguluisa itima vietu.\nOvitua vietu vi imbaile uvangi\nUwa wohenda lesunga liove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_355, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3117, position: 3, content: "Enju, a Yesu, ndombela yomele,\nSalalisa itima vietu.\nNdeci olondui vi yuka lovava\nHaico tu yuke lunene wove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_355, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3118, position: 4, content: "Enju, a Yesu, ndoku uha kuomele,\nTulumula itima vietu.\nOco, a Ñala, nda ekumbi lia enda ale,\nTu puyukile kombembua yove.", hymnsNumber: UmHymnsNumberSeeder.EVENING_HYMNS_355, typeStanza: HymnsContentCode.VERSE),

  ];
}